import logo from './logo.svg';
import './App.css';
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Data from './Data';

function App() {
  return (
    <div>
      <Routes>
        <Route path="/path" element={<Data/>}/>
      </Routes>
    </div>
  );
}

export default App;
